import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";
import Sidebar from "../layout/Sidebar";

const Home = props => {
  return (
    <div className="row">
      <div className="d-none d-sm-block col-md-3 col-lg-2">
        <Sidebar />
      </div>
      <main
        className="col-xs-12 col-sm-12 col-md-9 col-lg-10 ml-sm-auto  px-4"
        role="main"
      >
        <Search />
        <Breweries />
      </main>
    </div>
  );
};
// style={styles}
const styles = {
  backgroundColor: "rgba(255, 193, 7, 0.3)"
};

Home.propTypes = {};

export default Home;
